import React from 'react'

function skillBadge(props) {
  return (
    <div>
     <div className="item">
      <img
        src={props.imglink}
        alt="Image"
        style={{ height: 100, width: 100 }}
      />
      <h5 style={{ margin: 10 }}>{props.skillName}</h5>
    </div>
      
    </div>
  )
}

export default skillBadge
